  return (    
      <Router basename={process.env.PUBLIC_URL}>
        <Container fluid >
          <div >
            <NavBar />
            <Route exact path={`/`} render={ (routerProps) => <Home routerProps={routerProps}/>}/>
            <Route exact path="/countries/:slug" component={Show} />
